import React from "react"
import Item from './Item'

function List(props){
    return(
        <div className="list">
            
            {
                props.items.map( item =>

                    <Item 
                        key={item.id}
                        id={item.id}
                        title={item.title}
                        image={item.image}
                        rating={item.rating}

                        onupdaterating={props.onupdaterating}
                        onremove={props.id}
                    />

                    

                )
            }

            </div>
    );
}

export default List;
